import React, { useState } from "react";
import "../styles/AdminDashboard.css";

function AdminDashboard() {
  const [activeMenuItem, setActiveMenuItem] = useState("dashboard");

  const menuItems = [
    { id: "dashboard", label: "Dashboard" },
    { id: "doctors", label: "Doctors" },
    { id: "patients", label: "Patients" },
    { id: "appointments", label: "Appointments" },
    { id: "prescriptions", label: "Prescriptions" },
    { id: "reports", label: "Reports" },
    { id: "settings", label: "Settings" }
  ];

  const dashboardCards = [
    { title: "Total Doctors", count: "25", color: "#4CAF50" },
    { title: "Total Patients", count: "150", color: "#2196F3" },
    { title: "Appointments Today", count: "12", color: "#FF9800" },
    { title: "Total Revenue", count: "$5,240", color: "#9C27B0" }
  ];

  const recentAppointments = [
    { id: 1, patient: "John Doe", doctor: "Dr. Smith", time: "10:00 AM", status: "Confirmed" },
    { id: 2, patient: "Jane Wilson", doctor: "Dr. Johnson", time: "11:30 AM", status: "Pending" },
    { id: 3, patient: "Mike Brown", doctor: "Dr. Davis", time: "2:00 PM", status: "Completed" },
    { id: 4, patient: "Sarah Miller", doctor: "Dr. Wilson", time: "3:30 PM", status: "Confirmed" }
  ];

  return (
    <div className="admin-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h2>MedicNotes Admin</h2>
        <ul>
          {menuItems.map((item) => (
            <li
              key={item.id}
              className={activeMenuItem === item.id ? "active" : ""}
              onClick={() => setActiveMenuItem(item.id)}
            >
              {item.label}
            </li>
          ))}
        </ul>
      </div>

      {/* Main Content */}
      <div className="main-content">
        {/* Navbar */}
        <div className="navbar">
          <input type="text" placeholder="Search..." />
          <div className="profile">
            <span>Admin User</span>
            <div style={{ width: "32px", height: "32px", borderRadius: "50%", background: "#ccc" }}></div>
          </div>
        </div>

        {/* Dashboard Content */}
        <div className="dashboard">
          {/* Cards */}
          <div className="cards">
            {dashboardCards.map((card, index) => (
              <div key={index} className="card">
                <h3 style={{ color: card.color, margin: "0 0 10px 0" }}>{card.count}</h3>
                <p style={{ margin: "0", color: "#666" }}>{card.title}</p>
              </div>
            ))}
          </div>

          {/* Recent Appointments Table */}
          <div className="table-container">
            <h3 style={{ marginBottom: "20px", color: "#333" }}>Recent Appointments</h3>
            <table>
              <thead>
                <tr>
                  <th>Patient Name</th>
                  <th>Doctor</th>
                  <th>Time</th>
                  <th>Status</th>
                </tr>
              </thead>
              <tbody>
                {recentAppointments.map((appointment) => (
                  <tr key={appointment.id}>
                    <td>{appointment.patient}</td>
                    <td>{appointment.doctor}</td>
                    <td>{appointment.time}</td>
                    <td>
                      <span
                        style={{
                          padding: "4px 8px",
                          borderRadius: "4px",
                          fontSize: "12px",
                          fontWeight: "bold",
                          color: "#fff",
                          background:
                            appointment.status === "Confirmed"
                              ? "#4CAF50"
                              : appointment.status === "Pending"
                              ? "#FF9800"
                              : "#2196F3"
                        }}
                      >
                        {appointment.status}
                      </span>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
